import React from "react";
import "./About.css";

const About = () => {
  // 기능 구현 로직
  return (
    <div id="about">
      <div class="About">
        <div class="inner">
          <h1>ABOUT</h1>
        </div>
      </div>
      <div class="profile"><h1></h1></div>
      <div class="right">right</div>
    </div>
  );
};

export default About;
